import React from "react";
import "../styles/home.css";

function Home() {
    return (
        <div className="home">
            <div className="home-content">
                <h2 className="home-title">Welcome</h2>
                <span className="home-text"></span>
            </div>
        </div>
    );
}

export default Home;
